import React from "react";
import { Jumbotron } from "react-bootstrap";
import { Layout } from "../../components/Layout";

export const Home = (props) => {
  return (
    <div>
      <Layout>
          <Jumbotron style={{margin: '5rem', background: '#fff'}}>
              <h1>Welcome to admin dashboard</h1>
          </Jumbotron>
      </Layout>
    </div>
  );
};
